INSERT INTO `help_articles` (`id`, `title`, `description`, `category_id`, `created_by`, `created_at`, `status`, `files`, `total_views`, `sort`, `deleted`) VALUES
(1, 'تفكير في الضرائب مرفق ملف و الرابط ', '<p style=\"margin-bottom: 1.25em; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: HelveticaNeueW23; font-size: 14px; text-align: justify; width: auto !important;\">لضرائب من أشد الموضوعات المالية والاقتصادية حساسية، لأنه يختلط فيها التمويل مع التحفيز والكبح والثقة والكفاءة في إدارة الموارد عدا أنها مرتبطة بالحالة المجتمعية والتنظيمية من الحالة الراهنة إلى تصور استشرافي للحالة الجديدة. يتخلل هذه المفاهيم مدى الرغبة في التحديث والتفكير الجمعي في التحديات الاقتصادية. تأخذ الضرائب بعدا آخر حين يكون الاقتصاد ريعي المصدر وبالتالي تعمق التعود على الطبيعة المالية للاقتصاد. المصدر الرئيس لتمويل الاقتصاد يحدد الحيثيات الاقتصادية الإنتاجية لما يقوم به أغلب الناس من أعمال سواء أفرادا أو حتى \"شركات\"، إذ يفرض منظومة تصرفات تعود الجميع عليها. التعود قوة لا يستهان بها لأنها تشكل التصرفات في التوزيع لأن السياسة المالية في اقتصاد ريعي توزيعية بطبعها، فالتأثير في الاستهلاك والادخار والاستثمار مباشر.</p><p style=\"margin-bottom: 1.25em; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: HelveticaNeueW23; font-size: 14px; text-align: justify;\">لكن الحالة الاقتصادية والمالية تتغير بطبعها لذلك لا بد للرسوم وللضرائب وللزكاة (إعادة القراءة والتطبيق) أن تتغير حسب الاستحقاقات العامة ومدى الدقة في إدارة المجتمع. اقتصاديا وماليا هناك دائما ثوابت ومتغيرات حسب الحالة والتوجهات الجديدة. النجاح والتقصير يأتي في مدى مرونة الفهم والتفهم ولكن الطبيعة التوزيعية وأنماط التصرفات وسقف التوقعات تحد من المرونة في التجريب العملي وأحيانا حتى في الطرح الفكري.</p><p style=\"margin-bottom: 1.25em; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: HelveticaNeueW23; font-size: 14px; text-align: justify;\">عمليا ما دامت عوائد النفط تكفي لتمويل القطاع العام سيبقى الحديث عن الضرائب نظريا واستشرافيا ولكن حين تقل مداخيل النفط ويرتفع العجز لا بد من أفكار وخطوات عملية. مرحليا تمويل الاقتصاد (خاصة القطاع العام) يحتاج إعادة تأطير من خلال نموذج جديد. ركائز النموذج الجديد: 1 - العلاقة بين الخدمة المقدمة وتكلفتها الاقتصادية. 2 - توافر الحد الأدنى ماليا لإدارة الأجهزة العامة. 3 - التخصيص حين تكون السلسلة العملية كلها وطنية وليست بابا خلفيا لنوع آخر من التستر. 4 - توفير أكبر قدر ممكن من الأموال للاستثمار البشري والرأسمالي داخليا وخارجيا بغرض التكامل داخليا. 5 - مقاومة وتفادي خلط التوجهات الاقتصادية مع التحديات المالية. فهناك رسوم ضرورية لأنها مرتبطة بتقديم خدمة ثابتة مثل إصدار الجوازات ورخص القيادة ورخص البلديات، ولكن بعضها مثل التراخيص للصناعة لا بد أن تكون أكثر مرونة، وهناك أخرى لا بد أن تكون أكثر مرونة مثل رخص العمالة الوافدة التي بعضها أكثر مما هو مناسب اقتصاديا وكثير منها أقل مما هو مناسب لسياسة توطين أكثر جدية. أيضا هناك أنواع من الضرائب، فالضريبة المضافة تستهدف الاستهلاك (وأحيانا الاستيراد) لحماية المورد الوطني ولكن هذا أيضا يعتمد على وضوح سلم المحتوى الوطني في الصناعة، كذلك وجود أعداد كبيرة من الوافدين وبمداخيل متواضعة تكون الضريبة المضافة الأنسب لأن ضريبة الدخل غير ممكنة.</p><p style=\"margin-bottom: 1.25em; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: HelveticaNeueW23; font-size: 14px; text-align: justify;\">ولكن كلما ارتفعت الضريبة ارتفعت تكلفة رقابتها. في ظل الحالة النفطية وارتفاع تكاليف إدارة الحكومة خاصة في التوظيف وهيمنة الاستهلاك لا بد لضريبة المضافة من الارتفاع، لعل السؤال الموضوعي يستمر حول الدرجة ودقة التطبيق وتوزيع سلة السلع. الزكاة ربما هي الأنسب للأراضي ولكن هذا يتطلب دقة في التبويب النظامي، فلا يمكن أن تخضع للنيات ولكن تكون زكاة على كل أرض (ليست لبناء سكن شخصي) أو عقار تجاري كل حول، ولكن لا بد أيضا من ربطها بالمكان ولو جزئيا. الزكاة أو الضريبة على العقار استحقاق اقتصادي لأن الأراضي هي الوجه المقابل الطابع المالي للاقتصاد. ضريبة الدخل اعتياديا مرتبطة اقتصاديا بطبيعة النشاط. مرحليا أجدها ضرورية للشركات ولكن يصعب إيجاد منطق اقتصادي لفرضها على موظفي القطاع العام لأن مداخيلهم من الحكومة مباشرة على الرغم أن جزءا بسيطا منهم بمداخيل عالية قد لا تتناسب مع أدوارهم العملية. استشرافيا لا بد أن يكون كل موضوع مادي قابل للطرح والنقاش بما يخدم الاقتصاد الوطني.</p><p style=\"margin-bottom: 1.25em; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); font-family: HelveticaNeueW23; font-size: 14px; text-align: justify;\">كل اقتصاد يحتاج إلى ضرائب ورسوم حيث تكون أقل ما يمكن لرفع مستوى الحياة المعيشية وتحفيز الاستثمارات وأعلى ما يمكن لتقليل الهدر وتمويل النقص المالي للطمأنينة على ديمومة المنظومة المالية وسلامة الجسم الاقتصادي. من عناصر السلامة دعم مباشر لمن هو أقل حظا في سلم الدخل، ولكن تحديد هؤلاء مرتبط أيضا بمدى قدرتنا على إدارة الموارد البشرية والتحفيز في المجتمع. ستبقى الرسوم والضرائب مجال جدل في كل مرحلة لأسباب موضوعية ولذلك لا بد أن تكون جزءا من منظومة الإصلاح المالي من ناحية والنموذج الاقتصادي التنموي من ناحية أخرى.</p>', 2, 1, '2021-09-15 01:15:37', 'active', 'a:0:{}', 7, 0, 0);
